window.bookSummaryJSON = "Emily Croy Barker’s riveting debut novel is a must-read for fans of Lev Grossman and Deborah Harkness. <i>The Thinking Woman’s Guide to Real Magic</i> follows grad student Nora Fischer as she stumbles through a portal into a magical world. <p></p> <p>Having been transformed from drab to beautiful, Nora finds herself surrounded by glamorous friends. Life seems perfect. But then things take a terrible turn, and Nora must learn magic from a reclusive ally if she is to have any hope of survival...</p>"; 
